import { Button, Cell, Grid, TextField, VFlow } from "bold-ui";
import React from "react";

export function FormLogin() {
  return (
    <Grid
      alignItems="center"
      direction="row"
      gap={2}
      gapVertical={1}
      justifyContent="center"
      style={gridStyles}
      wrap
    >
      <VFlow vSpacing={1}>
        <Cell lg={12} md={12} sm={12} xs={12}>
          <TextField label="Usuário" placeholder="CPF" required />
        </Cell>
        <Cell lg={12} md={12} sm={12} xs={12}>
          <TextField
            label="Senha"
            placeholder="Senha"
            type="password"
            required
          />
        </Cell>
        <Cell lg={12} md={12} sm={12} xs={12}>
          <Button kind="primary" size="medium">
            Entrar
          </Button>
        </Cell>
      </VFlow>
    </Grid>
  );
}

const gridStyles = css`
  width: 100%;
  padding: 1rem;
  margin: 0 !important;
`;
